import { Videos } from "../Utils/Videos"

export const Bonus = () => {
    return(
        <div>
            <div className="flex">
                <h2 className="text-2xl font-bold m-1">Influenceuse</h2>
                <p>J'aimerais partager avec vous ce petit court métrage qui n'a rien à voir avec le harcèlement,<br/>mais il reste très intéressant démontre bien le danger que peuvent représenter les réseaux sociaux</p>
                <Videos id="utkuLf8mE6k"/>
            </div>
        </div>
    )
}
